import React, { useState } from 'react';
import { useHistory } from 'react-router-dom';
import './Nav.css';

function Nav({ onSearch }) {
  const [searchQuery, setSearchQuery] = useState('');
  const history = useHistory();

  const handleSearchChange = (e) => {
    setSearchQuery(e.target.value);
  };

  const handleSearchSubmit = () => {
    onSearch(searchQuery); // Pass the search query to the parent component (Home)
    history.push('/'); // Optional: Redirect to the homepage or search results page
  };

  return (
    <>
      <div className='container'>
        <div className='shop wrapper'>
          <div className='sale'>
            <p>Summer Sale For All Swim Suits And Free Express Delivery - OFF 50%!</p>
            <button>ShopNow</button>
          </div>
          <form>
            <select>
              <option>English</option>
              <option>French</option>
              <option>Spanish</option>
              <option>German</option>
            </select>
          </form> 
        </div>
      </div>

      <div className='main'>
        <div className='nav wrapper'>
          <h1 className='left'>Exclusive</h1>
          <ul className='middle'>
            <li><a href='#'>Home</a></li>
            <li><a href='#'>Contact</a></li>
            <li><a href='#'>About</a></li>
            <li><a href='#'>Sign Up</a></li>
          </ul>
          <div className='right'>
            <div className='search'>
              <input 
                type='text' 
                placeholder='What are you looking for?' 
                value={searchQuery}
                onChange={handleSearchChange}
              />
              <img src='/assets/Component 2.png' alt='search' onClick={handleSearchSubmit} />
            </div>
            <ul>
              <li><a href='#'><img src='/assets/wishlist.png' /></a></li>
              <li><a href='#'><img src='/assets/cart-icon.webp' /></a></li>
            </ul>
          </div>
        </div>
      </div>
    </>
  );
}

export default Nav;
